import React from 'react';
import './App.css';
import {BrowserRouter as Router,Route} from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css"
import Navbar from "./components/navbar";
import AppoinmentList from "./components/AppoinmentList";
import EditAppoinment from "./components/EditAppoinment";
import CreateAppoinment from "./components/CreateAppoinment";
import CreateAddress from "./components/CreateAddress";


function App() {
  return (
    <Router>
      <img src="/images/logo-srh.png" alt=""/>
      <div><label className= "info">Phone: +49 6221 88-1000 <br/> Email: info@hochschule-heidelberg.de
      </label></div> 
      <Navbar/>
      <br/>
      <Route path="/" exact component ={AppoinmentList}/>
      <Route path="/edit/:id" component ={EditAppoinment}/>
      <Route path="/create" component ={CreateAppoinment}/>
      <Route path="/user" component ={CreateAddress}/>
    </Router>

  );
}

export default App;
